import { JsonWebcamDump, Webcam } from '../shared';

export default class WebcamData {
  webcams: Webcam[];

  constructor(json?: JsonWebcamDump) {
    this.webcams = json ? WebcamData.deserialize(json) : WebcamData.DEBUG_DATA;
  }

  static deserialize(json: JsonWebcamDump): Webcam[] {
    return [
      { identifier: 'cam0', image: json.cam0 },
      { identifier: 'cam1', image: json.cam1 },
    ];
  }

  private static readonly DEBUG_DATA: Webcam[] = [
    {
      identifier: 'cam0',
      image:
        'data:image/jpeg;base64,',
    },
    {
      identifier: 'cam1',
      image:
        'data:image/jpeg;base64,',
    },
  ];
}
